import React from 'react'
import { useSelector } from 'react-redux';

export const Cart = () => {



    const cartdata = useSelector((state) => state);

    console.log(cartdata);

    return (
        <div>
            <h1>Cart</h1>

            {
                cartdata.map((cart) => {
                    return (
                        <div>
                            <img src={cart.image} alt={cart.title} />
                            <h1>{cart.title}</h1>
                            <button>+</button>
                            <p>{cart.qty}</p>
                            <button>-</button>
                            <p>{cart.price}</p>
                        </div>
                    )
                })
            }

        </div>
    )
}
